DELIMITER $$
CREATE TRIGGER `trig_BEF_INS_Category_CBO` BEFORE INSERT ON `category` FOR EACH ROW BEGIN
    SELECT IFNULL(Name, '') INTO @CatTypeName FROM CategoryType WHERE ID=NEW.CategoryTypeID;
    
    SET NEW.CBOExpression=CASE WHEN NEW.ID=-1 THEN ''
							   ELSE  CONCAT(@CatTypeName , ' / ' , IFNULL(NEW.Name, ''))
						  END;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trig_BEF_UPD_Category_CBO` BEFORE UPDATE ON `category` FOR EACH ROW BEGIN
    SELECT IFNULL(Name, '') INTO @CatTypeName FROM CategoryType WHERE ID=NEW.CategoryTypeID;
    
    SET NEW.CBOExpression=CASE WHEN NEW.ID=-1 THEN ''
							   ELSE  CONCAT(@CatTypeName , ' / ' , IFNULL(NEW.Name, ''))
						  END;
END
$$
DELIMITER ;

