(3, -1, 'A Walk to Remember', 'https://allyoumedia.s3.amazonaws.com/ItemPhotoIMG/3/A_Walk_to_Remember.jpg', '5.00', 1, '2018-08-16 22:06:04', '2018-08-16 22:07:26', '5.00', NULL, 1, 10, 1, 0, 'Sparks wrote the manuscripts for A Walk to Remember, his third novel, in the summer of 1999. He wrote it in North Carolina, which is the setting of the novel', 'Sparks wrote the manuscripts for A Walk to Remember, his third novel, in the summer of 1999. He wrote it in North Carolina, which is the setting of the novel.[1] Like his first published novel The Notebook, the prologue to A Walk to Remember was written last.[2] The title A Walk to Remember was taken from one of the tail end pages of the novel: \"In every way, a walk to remember.\"[3][4] The novel is written in first-person, and its narrator is a seventeen-year-old boy, living in the 1950s.[1]\r\n\r\nThe novel was inspired by Sparks\' sister,[1][5] Danielle Sparks Lewis, who later died of cancer in June 2000. Although the story is largely fictional, certain parts were based on real experiences.[4] For example, his sister, just like Jamie, was never popular at school and always wore an ugly sweater. And just like Jamie, she always carried the Bible around with her everywhere she went.', NULL, 1, 1, 8),
(4, -1, 'Tomorrow Never Dies', 'https://allyoumedia.s3.amazonaws.com/ItemPhotoIMG/4/Img1.jpg', '3.00', 1, '2018-10-16 19:45:17', '2019-02-16 22:00:04', '3.00', NULL, 0, 0, 0, 0, 'Music from  James Bond film', 'Tomorrow Never Dies is the soundtrack of the 18th James Bond film of the same name. David Arnold composed the score of Tomorrow Never Dies, his first full Bond soundtrack', NULL, 0, 0, 14);

