--
-- Triggers `subcategory`
--
DELIMITER $$
CREATE TRIGGER `trig_BEF_INS_SubCategory_CBO` BEFORE INSERT ON `subcategory` FOR EACH ROW BEGIN
    SELECT IFNULL(CBOExpression, '') INTO @CatName FROM Category WHERE ID=NEW.CategoryID;
    
    SET NEW.CBOExpression=CASE WHEN NEW.ID=-1 THEN ''
							   ELSE  CONCAT(@CatName , ' / ' , IFNULL(NEW.Name, ''))
						  END;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trig_BEF_UPD_SubCategory_CBO` BEFORE UPDATE ON `subcategory` FOR EACH ROW BEGIN
    SELECT IFNULL(CBOExpression, '') INTO @CatName FROM Category WHERE ID=NEW.CategoryID;
    
    SET NEW.CBOExpression=CASE WHEN NEW.ID=-1 THEN ''
							   ELSE  CONCAT(@CatName , ' / ' , IFNULL(NEW.Name, ''))
						  END;
END
$$
DELIMITER ;

